-- sales_fact определение

-- Drop table

-- DROP TABLE sales_fact;

CREATE TABLE sales_fact (
	row_id serial4 NOT NULL,
	sk_order_id int4 NULL,
	sk_customer_id int4 NULL,
	sk_place_id int4 NULL,
	sk_manager_id int4 NULL,
	sk_product_id int4 NULL,
	sales numeric NULL,
	quantity int4 NULL,
	discount numeric NULL,
	profit numeric NULL,
	CONSTRAINT sales_fact_pkey PRIMARY KEY (row_id),
	CONSTRAINT fk_sales_customers FOREIGN KEY (sk_customer_id) REFERENCES customers_dim(sk_customer_id),
	CONSTRAINT fk_sales_managers FOREIGN KEY (sk_manager_id) REFERENCES managers_dim(sk_manager_id),
	CONSTRAINT fk_sales_orders FOREIGN KEY (sk_order_id) REFERENCES orders_dim(sk_order_id),
	CONSTRAINT fk_sales_places FOREIGN KEY (sk_place_id) REFERENCES places_dim(sk_place_id),
	CONSTRAINT fk_sales_products FOREIGN KEY (sk_product_id) REFERENCES products_dim(sk_product_id)
);
CREATE INDEX fk_1 ON sales_fact USING btree (sk_order_id);












